// import React, { useState } from "react";
// import { useParams } from "react-router-dom";
// import axios from "axios";
import "./ProjectsPath.css";
import { Link } from 'react-router-dom'


export default function ProjectsPath() {
  // const { type } = useParams();
  return (
    <>
<Card style={{ width: '18rem' }}>
  <Card.Body>
    <Card.Title>Card Title</Card.Title>
    <Card.Subtitle className="mb-2 text-muted">Card Subtitle</Card.Subtitle>
    <Card.Text>
      Some quick example text to build on the card title and make up the bulk of
      the card's content.
    </Card.Text>
    <Card.Link href="#">Card Link</Card.Link>
    <Card.Link href="#">Another Link</Card.Link>
  </Card.Body>
</Card>


      <div className="paths">
        <Link to={'web'}>
          <div className="paths-div">Web Applications</div>
        </Link>
        <Link to={'android'}>
          <div className="paths-div">Android Applications</div>
        </Link>
        <Link to={'ios'}>
          <div className="paths-div">IOS Applications</div>
        </Link>
        <Link to={'userexperience'}>
          <div className="paths-div">User Experiance</div>
        </Link>
        <Link to={'userinterface'}>
          <div className="paths-div">User Interfaces</div>
        </Link>
        <Link to={'security'}>
          <div className="paths-div">Security Systems</div>
        </Link>
      </div>
    </>
  );
}
